<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="UTF-8" />
    <meta name="viewport" content="width=device-width, initial-scale=1" />
    <title>AZ-104</title>
    <style>
        body {
            font-family: Arial, sans-serif;
            background-color: #f4f4f4;
            margin: 2px;
            padding: 3rem 1rem;
            display: flex;
            flex-wrap: wrap;
            gap: 0.2rem;
            /* Reduced gap for more compact layout */
            justify-content: center;
            box-sizing: border-box;
            /* Include padding in element's total width and height */
        }

        .card {
            background: white;
            border-radius: 5px;
            /* Slightly reduced border-radius */
            box-shadow: 0 2px 5px rgba(0, 0, 0, 0.1);
            padding: 15px;
            /* Remove padding from card */
            width: calc((100% / 10) - 0.5rem);
            /* Calculate width for 10 cards per row, accounting for gap */
            max-width: 60px;
            /* Set a max-width for individual cards */
            text-align: center;
            transition: transform 0.2s;
            cursor: pointer;
            display: flex;
            /* Use flexbox for centering content inside the card */
            align-items: center;
            justify-content: center;
            aspect-ratio: 1 / 1;
            /* Make cards square */
        }

        .card:hover {
            transform: scale(1.05);
        }

        .card a {
            text-decoration: none;
            color: black;
            /* Changed text color to black */
            background-color: transparent;
            /* No background color for the link */
            padding: 0.5rem;
            /* Padding for the number inside the card */
            border-radius: 3px;
            display: flex;
            align-items: center;
            justify-content: center;
            width: 100%;
            height: 100%;
            box-sizing: border-box;
        }

        a:focus {
            color: white;
        }


        .clicked {
            background-color: #4CAF50 !important;
            /* green */
            color: white !important;
        }

        .review {
            background-color: #9c27b0 !important;
            /* purple */
        }

        .reset-btn {
            position: fixed;
            left: 10px;
            padding: 0.6rem 1.2rem;
            font-size: 1rem;
            background-color: red;
            color: white;
            border: none;
            border-radius: 5px;
            cursor: pointer;
            z-index: 999;
        }

        .reset-btn.top {
            top: 10px;
        }

        .reset-btn.bottom {
            bottom: 10px;
        }
    </style>
</head>

        const completed = new Set(
            JSON.parse(localStorage.getItem('completed') || '[]')
        );
        const review = new Set(
            JSON.parse(localStorage.getItem('review') || '[]')
        );

        links.forEach((link, i) => {
            const card = document.createElement('div');
            card.className = 'card';
            card.ondblclick = () => handleDoubleClick(i);
            card.innerHTML = `<a href="${link}" onclick="markCompleted(${i}, event)">${i + 1
                }</a>`;
            document.body.appendChild(card);
        });

        // On load
        window.onload = () => {
            applyClasses();
        };

        // Mark as completed
        function markCompleted(index, event) {
            event.preventDefault();
            completed.add(index);
            review.delete(index);
            saveStates();
            applyClasses();
            window.open(event.target.href, '_blank');
        }

        // Handle double-click to mark/unmark review
        function handleDoubleClick(index) {
            if (review.has(index)) {
                review.delete(index);
            } else {
                review.add(index);
                completed.delete(index);
            }
            saveStates();
            applyClasses();
        }

        // Reset all highlights
        function resetHighlights() {
            localStorage.removeItem('completed');
            localStorage.removeItem('review');
            completed.clear();
            review.clear();
            applyClasses();
        }

        // Save states to localStorage
        function saveStates() {
            localStorage.setItem(
                'completed',
                JSON.stringify([...completed])
            );
            localStorage.setItem('review', JSON.stringify([...review]));
        }

        // Apply class styling
        function applyClasses() {
            document.querySelectorAll('.card').forEach((card, i) => {
                card.classList.remove('clicked', 'review');
                if (completed.has(i)) card.classList.add('clicked');
                if (review.has(i)) card.classList.add('review');
            });
        }
    </script>

    <!-- Reset Button -->
    <button onclick="resetHighlights()" class="reset-btn bottom">
        Reset Highlights
    </button>
</body>
